import React from "react";
import { SafeAreaView, StyleSheet,Text,TouchableOpacity,View } from "react-native";

import { useNavigation}  from "@react-navigation/native";






export default function Login(){
    const navigation=useNavigation()
   
   return(
<SafeAreaView >
 <View style={{flexDirection:"row", justifyContent: 'space-between'}}>
    <TouchableOpacity onPress={() => navigation.navigate("Cadusuario")}>
        <Text >Mudar de Tela Cadusuario</Text>
    </TouchableOpacity>
    <TouchableOpacity onPress={() => navigation.navigate("Dashiboard")}>
        <Text >Mudar de Tela Dashiboard</Text>
    </TouchableOpacity>
    </View>
     <View > 
     <Image style={ styles.Image} source={ require("./assets/android1.jpg")} />
     </View>

</SafeAreaView>

    );
}
const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
    },
    
    Image:{
      fontSize: 40,
      width:"10%",
      marginTop:10,
      height: 30, 
      padding:20,
      marginBottom:20,
      resizeMode:'contain',
    },
})
